import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';


import {
    Header
} from './components';

const App = () => {
    const [userList, setUserList] = useState([]);
    return (
        <div id="App">
            <Header userList={userList} />
        </div>
    );
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
);
